import React from 'react';
import styled from 'styled-components';
const Card = () => {
    return (
        <div>
            <img src="https://cdn.dribbble.com/users/2400293/screenshots/16527147/media/f079dc5596a5fb770016c4ea506cd77b.png?compress=1&resize=1000x750&vertical=center" alt="" />
            <div>
                <div>
                    <div>
                        <img src="https://cdn.dribbble.com/users/2400293/screenshots/16527147/media/f079dc5596a5fb770016c4ea506cd77b.png?compress=1&resize=1000x750&vertical=center" alt="" />
                    </div>
                </div>
                <div></div>
            </div>
        </div>
    );
};

export default Card;
